import React from 'react';
import Slider from 'react-slick';
import 'slick-carousel/slick/slick.css';
import 'slick-carousel/slick/slick-theme.css';

export default function PantallaInicio() {
  const settings = {
    dots: true,
    infinite: true,
    autoplay: true,
    autoplaySpeed: 3000,
    arrows: false
  };

  const imagenes = [
    'https://picsum.photos/id/1050/1600/400',
    'https://picsum.photos/id/1060/1600/400',
    'https://picsum.photos/id/1070/1600/400'
  ];

  return (
    <div>
      <Slider {...settings}>
        {imagenes.map((img, i) => (
          <div key={i}>
            <img src={img} alt={`img-${i}`} style={{ width: '100%', height: '400px', objectFit: 'cover' }} />
          </div>
        ))}
      </Slider>
    </div>
  );
}
